import React from 'react';
import NavBar from '../header';
import NYC from './Photos/NYC/NYC';
import NewportBeach from './Photos/NewportBeach/NewportBeach';
import SanFrancisco from './Photos/SF/SanFrancisco';
import SantaBarbara from './Photos/SantaBarbara/SantaBarbara';
import StanfordFB from './Photos/StanfordFootball/StanfordFB';
import WashingtonDC from './Photos/WashingtonDC/WashingtonDC';
import Yosemite from './Photos/Yosemite/Yosemite';

const photos = () => {
  return (
    <div>
      <NavBar />

      <NYC />
      <NewportBeach />
      <SanFrancisco />
      <SantaBarbara />
      <StanfordFB />
      <WashingtonDC />
      <Yosemite />

    </div>
  )
};

export default photos;
